import React, { useState } from "react";

const techIcons: {
  [key: string]: {
    name: string;
    svg: JSX.Element;
  };
} = {
  tailwind: {
    name: "Tailwind CSS",
    svg: (
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 54 33" className="w-6 h-6">
        <g clipPath="url(#a)">
          <path
            fill="#38bdf8"
            fillRule="evenodd"
            d="M27 0c-7.2 0-11.7 3.6-13.5 10.8 2.7-3.6 5.85-4.95 9.45-4.05 2.054.513 3.522 2.004 5.147 3.653C30.744 13.09 33.808 16.2 40.5 16.2c7.2 0 11.7-3.6 13.5-10.8-2.7 3.6-5.85 4.95-9.45 4.05-2.054-.513-3.522-2.004-5.147-3.653C36.756 3.11 33.692 0 27 0zM13.5 16.2C6.3 16.2 1.8 19.8 0 27c2.7-3.6 5.85-4.95 9.45-4.05 2.054.514 3.522 2.004 5.147 3.653C17.244 29.29 20.308 32.4 27 32.4c7.2 0 11.7-3.6 13.5-10.8-2.7 3.6-5.85 4.95-9.45 4.05-2.054-.513-3.522-2.004-5.147-3.653C23.256 19.31 20.192 16.2 13.5 16.2z"
            clipRule="evenodd"
          />
        </g>
        <defs>
          <clipPath id="a">
            <path fill="#fff" d="M0 0h54v32.4H0z" />
          </clipPath>
        </defs>
      </svg>
    ),
  },
  html: {
    name: "HTML",
    svg: (
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 54 33" className="w-6 h-6">
        {/* AquÃ­ el SVG para HTML */}
      </svg>
    ),
  },
  css: {
    name: "CSS",
    svg: (
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 54 33" className="w-6 h-6">
        {/* AquÃ­ el SVG para CSS */}
      </svg>
    ),
  },
  javascript: {
    name: "JavaScript",
    svg: (
      <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 54 33" className="w-6 h-6">
        {/* AquÃ­ el SVG para JavaScript */}
      </svg>
    ),
  },
};

const projects = [
  {
    id: 1,
    title: "Portfolio Personal",
    category: "Vanilla",
    description: "Un portfolio minimalista hecho con HTML, CSS y JavaScript.",
    image: "/images/743shots_so.png",
    tech: ["HTML", "CSS", "JavaScript"],
    links: {
      code: "https://github.com/username/portfolio",
    },
  },
  {
    id: 2,
    title: "E-commerce React",
    category: "Otros",
    description: "Tienda online con React, Tailwind y Firebase.",
    image: "/images/816shots_so.png",
    tech: ["React", "Tailwind", "Firebase"],
    links: {
      code: "https://github.com/username/ecommerce",
    },
  },
  {
    id: 3,
    title: "Blog WordPress",
    category: "WordPress",
    description: "Un blog profesional optimizado con WordPress.",
    image: "/images/743shots_so.png",
    tech: ["WordPress", "PHP"],
    links: {
      code: "https://example.com/demo-blog",
    },
  },
  {
    id: 4,
    title: "CRM Python",
    category: "Otros",
    description: "Sistema CRM para pequeÃ±as empresas usando Django.",
    image: "/images/743shots_so.png",
    tech: ["Python", "Django"],
    links: {
      code: "https://github.com/username/crm",
    },
  },
];

const Projects = () => {
  const [filter, setFilter] = useState("Todos");

  const filteredProjects =
    filter === "Todos" ? projects : projects.filter((p) => p.category === filter);

  return (
    <section id="projects" className="bg-opacity-0 text-white py-16 px-8">
      <h2 className="text-4xl font-bold text-center mb-8">Proyectos</h2>

      {/* Filtros por categorÃ­a */}
      <div className="flex justify-center gap-4 mb-8">
        {["Todos", "Vanilla", "WordPress", "Otros"].map((category) => (
          <button
            key={category}
            onClick={() => setFilter(category)}
            className={`px-4 py-2 rounded-lg font-medium ${
              filter === category
                ? "bg-color2 text-white text-xl"
                : "bg-color5 text-gray-200 hover:bg-color2 text-xl"
            } transition`}
          >
            {category}
          </button>
        ))}
      </div>

      {/* Proyectos filtrados */}
      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-2 gap-10 max-w-6xl mx-auto">
        {filteredProjects.map((project) => (
            <div
            key={project.id}
            className="relative group overflow-hidden rounded-3xl shadow-lg w-full aspect-square transform transition-all duration-300 hover:shadow-2xl hover:scale-105"
            >
            {/* Imagen del proyecto */}
            <img
              src={project.image}
              alt={project.title}
              className="w-full h-full object-cover group-hover:opacity-70 group-hover:blur-sm transition-all duration-300 rounded-3xl"
            />

            {/* Slider de informaciÃ³n */}
            <div
              className="absolute inset-0 flex flex-col items-center justify-center bg-color5 bg-opacity-90 p-6 text-center transform translate-y-full group-hover:translate-y-0 transition-all duration-300 rounded-2xl"
            >
              <h3 className="text-2xl font-bold mb-3">{project.title}</h3>
              <p className="text-lg mb-4">{project.description}</p>

              {/* TecnologÃ­as */}
              <div className="flex flex-wrap justify-center gap-3 mb-4">
                {project.tech.map((tech, index) => (
                  <div key={index} className="flex items-center gap-2">
                    {/* Mostrar el icono */}
                    {techIcons[tech]?.svg && <span>{techIcons[tech].svg}</span>}

                    {/* Mostrar el nombre de la tecnologÃ­a */}
                    <span className="px-3 py-1 text-md bg-color3 rounded-3xl">{tech}</span>
                  </div>
                ))}
              </div>
              

              {/* Enlaces */}
              <div className="flex gap-4">
                {project.links.code && (
                  <a
                    href={project.links.code}
                    target="_blank"
                    rel="noopener noreferrer"
                    className="bg-color2 text-white px-5 py-2 rounded-lg hover:bg-color4 transition"
                  >
                    CÃ³digo Fuente
                  </a>
                )}
              </div>
            </div>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Projects;
